import React, { Component } from 'react';

class Cart extends Component {
    render() {
        return (
                <div className="cart">
                        <a href className="nav-item nav-link">
                        <div className="heading heading-custom ">
                            <i className="fa-solid fa-cart-shopping" /> Giỏ hàng
                        </div>
                        </a>
                </div>
        );
    }
}

export default Cart;
